import React from 'react';
import './CreateLobby.css';
import { BotSettings } from './BotSettings';
import { LobbySettings } from './LobbySettings';

export function CreateLobby() {
  return (
    <div>
      <div style={{display: 'flex'}}>
        <p style={{ marginRight: 'auto'}}>Logo</p>
        <p style={{ fontSize: 36, fontWeight: 900 }}>{'CREATE CHATROOM'}</p>
        <div className={'box-container'} style={{marginLeft: 'auto', width: 200}}>
          <p>
            Start Chat
          </p>
        </div>
      </div>

      <div className={'main-header'}>
        <p style={{ fontSize: 25 }}>{'Chatroom Code'}</p>
        <div
          className={'box-container'}
          style={{ width: 305, height: 120, margin: 'auto' }}
        >
          <p style={{ fontSize: 36 }}>L P R B</p>
        </div>
        <p> Join Link: </p>
      </div>

      <div style={{ display: 'flex', justifyContent: 'space-between' }}>
        <LobbySettings />
        <BotSettings />
      </div>
    </div>
  );
}
